import React from "react";
import '../css/Home.css';
import Container from "react-bootstrap/Container";


function Contact() {
    return (
        <Container>
            <div>
                Intresserad av att gå med i NKM? Skriv upp dig på vår intresselista eller maila kbm@ths.kth.se!
            </div>
        </Container>
    )
}

export default Contact
